import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './template/home';
import Website from './template/Website';
import Form from './template/Form';
import Trafego from './template/Tráfego';
import Marketing from './template/Marketing';
import Whatsapp from './template/Whatsapp';
import Thankss from './template/Thanks';

import Observer from './componenents/observer';
export default function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route
            path="/Trafego"
            element={
              <Observer>
                <Trafego />
              </Observer>
            }
          />
          <Route
            path="/Form"
            element={
              <Observer>
                <Form />
              </Observer>
            }
          />
          <Route
            path="/Website"
            element={
              <Observer>
                <Website />
              </Observer>
            }
          />
          <Route
            path="/Marketing"
            element={
              <Observer>
                <Marketing />
              </Observer>
            }
          />
          <Route
            path="/Whatsapp"
            element={
              <Observer>
                <Whatsapp />
              </Observer>
            }
          />
          <Route
            path="/Thankss"
            element={
              <Observer>
                <Thankss />
              </Observer>
            }
          />
        </Routes>
      </Router>
    </div>
  );
}
